    return (
      <div>
        <Plot
        data={[
          {
            x: [1, 2, 3],
            y: [2, 6, 3],
            type: 'scatter',
            mode: 'lines+points',
            marker: {color: 'red'},
          },
          {type: 'bar', x: [1, 2, 3], y: [2, 5, 3]},
        ]}
        layout={ {width: 500, height: 500, title: 'A Fancy Plot'} }
      />
      </div>
    )
  }
}

const mapStateToProps = state =>{
    console.log(state.dataAll)
    return{
        dataAll: state.dataAll
    }
}

export default connect (
    mapStateToProps,
    {getDataAll}
)(ChoroplethMap)
